DROP SCHEMA IF EXISTS bonus;
CREATE SCHEMA IF NOT EXISTS bonus DEFAULT CHARACTER SET UTF8;

DROP TABLE IF EXISTS bonus.empleados;
CREATE TABLE bonus.empleados (
	idEmpleado INT,
	nombre VARCHAR(50),
	apellido VARCHAR(50),
	genero VARCHAR(50),
	ingreso DATE,
	idEditorial INT
);


DROP TABLE IF EXISTS bonus.autores;
CREATE TABLE bonus.autores (
	idAutor INT,
	nombre VARCHAR(50),
	apellido VARCHAR(50),
	genero VARCHAR(50),
	nacimiento DATE,
	direccion VARCHAR(50),
	provincia VARCHAR(50),
	pais VARCHAR(50)
);

